import './App.css';

function App() {
  return (
    <div className="App">
     <h1>To do</h1>
     <div className="form">
    <label>List Name</label>
     <input type="text" name="listName"></input>
     <label>List item</label>
     <input type="text" name="listitem"></input>
     </div>
    </div>
  );
}

export default App;
